import React from 'react';
import { PostInfoStyled } from './Postinfo.style';

const PostInfo = ({
  title,
  description,
  imageUrl,
  content
}) => {
  return (
    <PostInfoStyled>
      <img src={imageUrl} alt={title} />
      <div className="postinfo__content">
        <h3>Titre: {title}</h3>
        <div>Description: {description}</div>
        <div>Contenu: {content}</div>
      </div>
    </PostInfoStyled>
  );
};

export { PostInfo };
